//GET LIST
export const listTeamMembersRequest = function(){
  return {
    type: "LIST_CONCEPTS_REQUEST"
  }
}

export const listTeamMembersSuccess = function(team_members) {
  return {
    type: "LIST_TEAM_MEMBERS_SUCCESS",
    team_members
  }
}

export const listTeamMembersError = function() {
  return {
    type: "LIST_TEAM_MEMBERS_ERROR"
  }
}
